pragma solidity 0.5.16;

import "./ERC721Full.sol";

contract Group2 is ERC721Full {
    string[] public datas;
    mapping(string => bool) _dataExists;

    constructor() ERC721Full("Group2", "GROUP2") public {
    }

    function mint(string memory _data) public {
      require(!_dataExists[_data]);
      uint _id = datas.push(_data);
      _mint(msg.sender, _id);
      _dataExists[_data] = true;
    }

    function burn(uint _tokenId) public {
      require(_isApprovedOrOwner(msg.sender, _tokenId));
      _burn(ownerOf(_tokenId), _tokenId); 
    }

}
